import React from 'react';

const Dashboard = ({ handleLogout }) => {
    return (
        <div className="dashboard-container">
            {/* Header */}
            <header className="dashboard-header">
                <h1>Welcome to CodeDojo</h1>
                <button onClick={handleLogout} className="logout-btn">Logout</button>
            </header>

            {/* Main Dashboard Content */}
            <div className="dashboard-content">
                <div className="dashboard-card">
                    <h2>Profile</h2>
                    <p>Username: <strong>Coder123</strong></p>
                    <p>Rank: <strong>Beginner</strong></p>
                </div>

                <div className="dashboard-card">
                    <h2>Progress</h2>
                    <p>Challenges Completed: <strong>5</strong></p>
                    <p>Next Challenge: <strong>JavaScript Basics</strong></p>
                </div>

                <div className="dashboard-card">
                    <h2>Upcoming Features</h2>
                    <p>The coding environment is coming soon! Stay tuned for updates.</p>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
